import './App.css';

import Cart from './component/cart/Cart';
import { Home } from './component/home/Home';
import {createBrowserRouter,createRoutesFromElements,RouterProvider,Route,Link,Outlet,Routes} from 'react-router-dom'
import { Groceries } from './component/menu/groceries/Groceries';
import { Electronics } from './component/menu/electronics/Electronics';
function App() {
  const router = createBrowserRouter(
    createRoutesFromElements(
      <Route path="/" element={<Root />}>
        <Route index element={<Home />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/clothing" element={<Cart />} />
        <Route path="/electronics" element={<Electronics />} />
        <Route path="/groceries" element={<Groceries />} />
      </Route>
    )
  );
  return (
    <div className="App">
      <RouterProvider router={router}>
        <Routes /> {/* Use the Routes component here */}
      </RouterProvider>
    </div>
  );
}
export default App;

const Root =()=>{
  return (
    <>
      <div>
        <Outlet />
      </div>
    </>
  )
}
